import react from 'react';

export default function Header() {
  return (
    <>
      {(window.innerWidth < 577) ?
        <div></div>
        :
        <nav className="header navbar navbar-expand-lg navbar-light bg-white">

        </nav>  
    }
    </>
  )
}
